import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "./App.css";
import * as BooksAPI from "./BooksAPI";

function SearchBooks({location}) {
  const [books, setBooks] = useState([]);
  const [searchResult, setSearchResult] = useState([]);
  const [searchError, setSearchError] = useState(false);

  useEffect(() => {
    setBooks(location.state.books);
  }, [location.state.books]);

  const searching = (event) => {
    const searchInput = event.target.value;

    if (searchInput) {
      BooksAPI.search(searchInput).then((resultBooks) => {
        if (!resultBooks || resultBooks.hasOwnProperty("error")) {
          setSearchResult([]);
          setSearchError(true);
        } else {
          setSearchResult(resultBooks);
          setSearchError(false);
          syncBookShelf();
        }
      });
    } else {
      setSearchResult([]);
    }
  };

  const syncBookShelf = (books, searchResult) => {
    if (books && searchResult) {
      books.forEach(book => {
        searchResult.forEach(searchResultBook => {
          if (book.id === searchResultBook.id) {
            searchResultBook.shelf = book.shelf
          }
        })
      });

      setSearchResult(searchResult);
    }
  };  

  const changeShelf = (book, shelf) => {
    BooksAPI.update(book, shelf).then((result) => {
      book.shelf = shelf;
      var updatedBooks = books.filter(
        (resultBook) => resultBook.id !== book.id
      );
      updatedBooks.push(book);
      setBooks(updatedBooks);
    });
  };

    return (
        <div className="search-books">
          <div className="search-books-bar">
            <Link className="close-search" to="/">
            Close
            </Link>
            <div className="search-books-input-wrapper">
              <input
                type="text"
                onChange={searching}
                placeholder="Search by title, author, or ISBN"
              />
            </div>
          </div>
          <div className="search-books-results">
          {searchResult.length > 0 && (
          <div>
            <div>
              <h3> {searchResult.length} books found!</h3>
            </div>
            <ol className="books-grid">
            {searchResult.map((book) => (
              //BOOK
                <li>
                <div className="book">
                    <div className="book-top">
                        <div className="book-cover" style={{ width: 128, height: 193, backgroundImage: `url(${book.imageLinks})` }}>
                        </div>
                        <div className="book-shelf-changer">
                            <select
                                onChange={(event) => changeShelf(book, event.target.value)}
                                value={book.shelf ? book.shelf : 'none'}>
                                <option value="moveTo" disabled>Move to...</option>
                                <option value="currentlyReading">Currently Reading</option>
                                <option value="wantToRead">Want to Read</option>
                                <option value="read">Read</option>
                                <option value="none">None</option>
                            </select>
                        </div>
                    </div>
                    <div className="book-title">{book.title ? book.title : null}</div>
                    {book.authors &&
                        book.authors.map((author, index) => (
                            <div className="book-authors" key={index}>{author}</div>
                        ))}
                </div>
            </li>
            //BOOK
              ))}
            </ol>
          </div>
        )}
        {searchError && (
          <div>
            <h3>No book found. Please try again !</h3>
          </div>
        )}
        </div>
        </div>
    );
};

export default SearchBooks;
